import React from 'react'
import "./index.css"


const App = () => {
  const crntTime = new Date().toLocaleDateString()
// const crntDime = new Date().toLocaleTimeString()
const getData = "";
  if ((crntTime >= 1) && (crntTime < 12)) {
    getData = "Good Morning"
  } else if ((crntTime >= 1) && (crntTime < 19)) {
    getData = "Good Afternon"
  } else {
    getData = "Good Night"
  }
  return (
    <>
      <div className="container_now">
        <div className="heading">
          <h1>HELLO DEAR {getData}</h1>
        
        </div>
      </div>
    </>
  )
}

export default App;
